    .heading {
      position: relative;
      font-family: Verdana, serif;
      color: #fff;
      font-size: 44px;
      text-align: center;
    }
    .heading-2 {
      font-family: Verdana, serif;
      color: #fff;
      font-size: 26px;
      font-weight: 400;
      text-align: center;
    }
    .section {
      position: absolute;
      left: 0%;
      top: auto;
      right: 0%;
      bottom: 0%;
      display: block;
      grid-auto-columns: 1fr;
      grid-column-gap: 16px;
      grid-row-gap: 16px;
      -ms-grid-columns: 1fr 1fr;
      grid-template-columns: 1fr 1fr;
      -ms-grid-rows: auto auto;
      grid-template-rows: auto auto;
      background-color: #000;
      opacity: 0.68;
    }
    .paragraph {
      position: relative;
      margin-top: 10px;
      font-family: Vollkorn, serif;
      color: #8f8f8f;
      text-align: center;
    }
    .section-2 {
      position: static;
      left: 25%;
      top: 25%;
      right: -25%;
      bottom: 25%;
      display: block;
      margin: auto;
    }
    .button {
      display: block;
      width: 120px;
      margin-top: 25px;
      margin-right: auto;
      margin-left: auto;
      border-style: solid;
      border-width: 1px;
      border-color: #fff;
      border-radius: 8px;
      background-color: rgba(99, 99, 99, 0);
      text-align: center;
    }
